import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'

const hour = new Date().getHours();

let result = () => {
  if(1<=hour && hour<=11){
    return "Good Morning";
  }
  else if(12<=hour && hour<=19){
    return "Good Afternoon";
  }
  else{
    return "Good Night";
  }
}

ReactDOM.render(
  <>
    <h1>Hello Sir,{result}</h1>
  </>
  ,document.getElementById('root')
)
